CREATE TABLE Employees (
	employee_ID INT(4) PRIMARY KEY NOT NULL,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	isActive BOOLEAN DEFAULT 1,
    employee_role VARCHAR(25),
	isVaccinated BOOLEAN NOT NULL DEFAULT 0,
	wasInfected BOOLEAN NOT NULL DEFAULT 0,
	email VARCHAR(50),
	telephone VARCHAR(20),
	date_of_birth DATE,
	medicare_number VARCHAR(12) UNIQUE NOT NULL,
	citizenship VARCHAR(50),
	postal_code VARCHAR(8),
	FOREIGN KEY (postal_code) REFERENCES Locations(postal_code) ON DELETE CASCADE
);

ALTER TABLE Employees
  MODIFY employee_ID INT NOT NULL AUTO_INCREMENT, AUTO_INCREMENT=100;
  

